import React from "react";
import '../style/header.css'
import logo from '../icon/icon.svg';
import home from '../icon/home.svg';

export class Header extends React.Component {
    constructor (props) {
        super(props)
        this.state = {
            list: [
                ['文章', ''],
                ['自省', ''],
                ['散心', '']
            ]
        }
    }

    render() {
        return (
            <div className="headerLine">
                <img alt="Home" src={home} className="header-home"></img>
                <ul className="header-page">
                    {this.state.list.map((item, index) => <li className="header-page-item" key={index}>{item[0]}</li>)}
                </ul>
                <img alt="myGithub" src={logo} className="header-github"></img>
            </div>
        )
    }
}
